package com.zhzx.dao.bean.prod;import com.zhzx.dao.bean.BaseBean;public class ProdPlanDetail extends BaseBean {		/**	*活动明细编号	*/	private String id;		/**	*活动编号	*/	private String planNo;		/**	*产品编号	*/	private String prodNo;		/**	*排列序号	*/	private String orderNo;		/**	*创建时间	*/	private String createTime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getPlanNo() {	    return this.planNo;	}	public void setPlanNo(String planNo) {	    this.planNo=planNo;	}	public String getProdNo() {	    return this.prodNo;	}	public void setProdNo(String prodNo) {	    this.prodNo=prodNo;	}	public String getOrderNo() {	    return this.orderNo;	}	public void setOrderNo(String orderNo) {	    this.orderNo=orderNo;	}	public String getCreateTime() {	    return this.createTime;	}	public void setCreateTime(String createTime) {	    this.createTime=createTime;	}}